import ChartUsuarioMes from './components/ChartUsuarioMes';

export default class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      users: [],
      weddings: [],
      appointments: [],
      invoices: []
    }
  }
  render () {
    return (
      <div className="App">
        <ChartUsuarioMes />
      </div>
    );
  }
}
